//github.com/sequelize/sequelize/wiki/Upgrading-to-2.0) and the changelog between 2.0 and 3.0. 2.1 also has a breaking change.\n\n## Features\n\n- Schema definition\n- Schema synchronization/dropping\n- 1:1, 1:M & N:M Associations\n- Through models\n- Promises\n- Hooks/callbacks/lifecycle events\n- Prefetching/association including\n- Transactions\n- Migrations\n- CLI ([sequelize-cli](https://github.com/sequelize/cli))\n\n## Resources\n- [Changelog](https://github.com/sequelize/sequelize/blob/master/changelog.md)\n- [Getting Started](http://docs.sequelizejs.com/en/latest/docs/getting-started/)\n- [Documentation](http://docs.sequelizejs.com/en/latest/)\n- [API Reference](http://docs.sequelizejs.com/en/latest/)\n- [Collaboration and pull requests](https://github.com/sequelize/sequelize/blob/master/CONTRIBUTING.md)\n- [Roadmap](https://github.com/sequelize/sequelize/issues/2869)\n- [Twitter](https://twitter.com/SequelizeJS): @SequelizeJS\n- [IRC](http://webchat.freenode.net?channels=sequelizejs): sequelizejs on Freenode\n- [Google Groups](https://groups.google.com/forum/#!forum/sequelize)\n- [Add-ons & Plugins](https://github.com/sequelize/sequelize/wiki/Add-ons-&-Plugins)\n",readmeFilename:"README.md",repository:{type:"git",url:"git+https://github.com/sequelize/sequelize.git"},scripts:{"build-docker":"docker-compose build",cover:"rimraf coverage && npm run teaser && npm run cover-unit && npm run cover-integration && npm run merge-coverage","cover-integration":"cross-env COVERAGE=true node_modules/.bin/istanbul cover ./node_modules/mocha/bin/_mocha --report lcovonly -- -t 60000 --ui tdd \"test/integration/**/*.test.js\" && node -e \"require('fs').renameSync('coverage/lcov.info', 'coverage/integration.info')\"","cover-unit":"cross-env COVERAGE=true node_modules/.bin/istanbul cover ./node_modules/mocha/bin/_mocha --report lcovonly -- -t 30000 --ui tdd \"test/unit/**/*.test.js\" && node -e \"require('fs').renameSync('coverage/lcov.info', 'coverage/unit.info')\"",docs:"nod